import yaml from 'js-yaml'
import {
  PERSON
} from '../../resume/data.yml'

// Called by templates to decrease redundancy
function getVueOptions (name) {
  let opt = {
    name: name,
    data () {
      return {
        person: yaml.load(PERSON)
      }
    }
  }
  return opt
}

export {
  getVueOptions
}
